function [predictions] = applyModelToFile(model, file)% read in the flow data, compensated[~, ~, ~, data] = fca_readfcs(file);if size(data, 1) == 0  fprintf("File has no compensation.\n");  return;end% remove unnecessary columnsdata = keepColumns(data, model.columns);% make predictionspredictions = predict(data, model.theta);% plot with predictionsplotFcs(data, model.header, predictions);end